import React, { Component } from 'react';

class Card extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <div>
                    <img src={this.props.Image} />
                </div>
                <div>{this.props.DisplayText}</div>
            </div>
        )
    }

}

export default Card;
